import React, {useState} from 'react';
import '../../style/LearnSet.css';


function LearnSet() {

    let wordSet = [
        {
            id: 1,
            part1: 'cat',
            part2: 'koshka'
        },
        {
            id: 2,
            part1: 'bog',
            part2: 'cobaka'
        }
    ]

    return (
        <div>



            <div className='button-wrapper'>
                <button className='button' >Study again</button>
                <button className='button' >Flip the card</button>
                <button className='button' color='#00b894' >Got it</button>
            </div>
        </div>
    )
}

export default LearnSet;
